    //判断单词
    judgeWord() {
        if (list.length == 1) {
            // this.hand.x = 200
            bool = 1
            clearInterval(this.hand_interval)
            // graphics_hand.visible = 0
            this.hand.visible = 0
            switch (list[0]) {
                case "1":
                    this.c.visible = 1
                    break;
                case "2":
                    this.u.visible = 1
                    break;
                case "3":
                    this.p.visible = 1
                    break;
                default:
                    break;
            }
        }
        if (list.length == 2) {
            switch (list[0] + list[1]) {
                case "12":
                    this.cu.visible = 1
                    break;
                case "13":
                    this.cp.visible = 1
                    break;
                case "21":
                    this.uc.visible = 1
                    break;
                case "23":
                    this.up.visible = 1
                    break;
                case "31":
                    this.pc.visible = 1
                    break;
                case "32":
                    this.pu.visible = 1
                    break;
                default:
                    break;
            }
        }
        if (list.length == 3) {
            switch (list[0] + list[1] + list[2]) {
                case "123":
                    this.cup.visible = 1
                    break;
                case "132":
                    this.cpu.visible = 1
                    break;
                case "213":
                    this.ucp.visible = 1
                    break;
                case "231":
                    this.upc.visible = 1
                    break;
                case "312":
                    this.pcu.visible = 1
                    break;
                case "321":
                    this.puc.visible = 1
                    break;
                default:
                    break;
            }
        }
    }

    //手引导
    showHand() {
        this.hand = this.add.image(200, 670, 'hand')
        this.hand.scaleX = 0.5
        this.hand.scaleY = 0.5
        this.tweens.add({
            targets: [this.hand],
            x: 390,
            duration: 600,
            callbackScope: this,
            onComplete: () => {
                setTimeout(() => {
                    this.tweens.add({
                        targets: [this.hand],
                        x: 200,
                        duration: 1
                    })
                }, 300);
            }
        })
        this.hand_interval = setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                x: 390,
                duration: 600,
                callbackScope: this,
                onComplete: () => {
                    setTimeout(() => {
                        this.tweens.add({
                            targets: [this.hand],
                            x: 200,
                            duration: 1
                        })
                    }, 300);
                }
            })
        }, 1800);
    }

    //引导划线
    showGraphic_hand() {
        if (bool == 0) {
            if (graphics_hand) {
                graphics_hand.visible = 0
            }
            graphics_hand = this.add.graphics(0, 0)
            graphics_hand.lineStyle(10, 0xFFFFFF, 1.0);
            graphics_hand.moveTo(160, 640);
            graphics_hand.lineTo(this.hand.x - 40, 640);
            graphics_hand.strokePath();
        } else {
            graphics_hand.visible = 0
            return
        }

    }

    // play_it
    play_it() {
        this.play_it = this.add.image(256, 765, 'play_it').setInteractive()
        setInterval(() => {
            this.tweens.add({
                targets: [this.play_it],
                scaleX: 0.9,
                scaleY: 0.9,
                duration: 500,
                callbackScope: this,
                onComplete: () => {
                    this.tweens.add({
                        targets: [this.play_it],
                        scaleX: 1,
                        scaleY: 1,
                        duration: 500,
                        callbackScope: this,
                        onComplete: () => {}
                    })
                }
            })
        }, 1000);
        this.play_it.on('pointerdown', () => {
            landingPage();
        }, this)
    }

