    download() {
        this.win_bg = this.add.image(256, 200, 'win_bg')
        this.continue = this.add.image(256, 600, 'continue').setInteractive()
        this.win_bg.scaleX = 0
        this.win_bg.scaleY = 0
        this.win_bg.setDepth(10)
        this.continue.scaleX = 0
        this.continue.scaleY = 0
        this.continue.setDepth(10)
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.9;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        this.tweens.add({
            targets: [this.win_bg, this.continue],
            scaleX: 1,
            scaleY: 1,
            duration: 500
        })
        this.input.off('pointerdown')
        this.continue.on('pointerdown', () => {
            landingPage();
        }, this)
    }


    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
